window.bookSummaryJSON = "<p>A superpowered collision of extraordinary minds and vengeful intentions - number-one <i>New York Times </i>best-selling author V. E. Schwab returns with the thrilling follow-up to <i>Vicious</i>.&nbsp;&nbsp;</p> <p>Magneto and Professor X. Superman and Lex Luthor. Victor Vale and Eli Ever. Sydney and Serena Clarke. Great partnerships, now soured on the vine.&nbsp;&nbsp;&nbsp;</p> <p>But Marcella Riggins needs no one. Flush from her brush with death, she’s finally gained the control she’s always sought - and will use her newfound power to bring the city of Merit to its knees. She’ll do whatever it takes, collecting her own sidekicks and leveraging the two most infamous EOs, Victor Vale and Eli Ever, against each other once more.&nbsp;&nbsp;</p> <p>With Marcella's rise, new enmities create opportunity - and the stage of Merit City will once again be set for a final, terrible reckoning.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p> <p>One of <i>Entertainment Weekly</i>'s \"27 Female Authors Who Rule Sci-Fi and Fantasy Right Now\".&nbsp;&nbsp;</p> <p>Villians:</p> <p></p> <ul> <li><i>Vicious</i>&nbsp;</li> <li><i>Vengeful</i>&nbsp;</li> <li>\"Warm Up\" (short story)</li> </ul>"; 
